import react from 'react';


function CardItem(){
    return (
        <div>
            <div className="card-image"></div>
            <span></span>
            <span className="card-price"></span>
            <div className="card-title"></div>
            <div className="card-description"></div>
        </div>
    );
}

export default CardItem;
